import React from 'react'
import login_icon from '../icons/login_icon.png'
import Button from "../buttons/button";
import Input_Label from "../Input_Label";

export default function Header() {
  const  login= () => {
    console.log('login');
    }
    return (
    <div className='border-2 h-10 place-items-center flex justify-between'>
      <h1>TRANSLATOR</h1>
      <h1>DICTIONARY</h1>
      <Button onClick={login} icon={login_icon}/>
      <Input_Label/>
    </div>
  )
}
